/**
 * Created by Lenovo on 2019/8/10.
 */
import React from 'react';
import '../share.css';
import './index.css';
export default class Input extends React.Component {
    constructor(props) {
        super(props);
    }
    change(event){
        const {onChange}=this.props;
        onChange(event.target.value);
    }
    render() {
        const {label,placeholder,type,src,renderRight} =this.props;
        return (
            <div className="cm-flex cm-ai-c cm-jc-sb cm-width-full">
                <div className="cm-flex cm-ai-c">
                {src? <img src={src} alt="" className="cm-img-small-icon"/>:<label htmlFor="">{label}</label>}
                <input type={type?type:"text"} onChange={(e)=>this.change(e)} className="cm-ml-10" placeholder={placeholder}/>
                </div>
                {renderRight?renderRight():null}
            </div>
        )
    }
}
